;===============================================================================
;======================================================================PJSIP_GEN
[global]
type=global
default_from_user=Bruno
user_agent=BRUNO-PBX


;===============================================================================
;=====================================================================TRANSPORTS
[transport-ipv4-udp]
type=transport
protocol=udp
bind=0.0.0.0:5060
local_net=192.168.160.0/20
;local_net=10.142.0.2/32

[transport-ipv4-tls]
type=transport
protocol=tls
method=tlsv1_2
cert_file=/etc/asterisk/keys/serverfullchain.pem  ; Descomente e use a cadeia
priv_key_file=/etc/asterisk/keys/server.key
ca_list_file=/etc/asterisk/keys/ca-fullchain.crt       ; Adicione o arquivo CA
verify_client=no
verify_server=no
bind=0.0.0.0:5061
local_net=192.168.160.0/20
cipher=0x002f

;[transport-ipv4-tls]
;type=transport
;protocol=tls
;method=tlsv1
;method=SSLv23
;method=tlsv1_2
;cert_file=/etc/asterisk/keys/serverchain.pem
;cert_file=/etc/asterisk/keys/server.crt
;priv_key_file=/etc/asterisk/keys/server.key
;ca_list_file=/etc/asterisk/keys/trusted_cas.crt
;verify_client=no
;verify_server=no
;bind=0.0.0.0:5061
;local_net=192.168.160.0/20
;local_net=10.142.0.2/32
;external_media_address=34.148.128.58
;external_signaling_address=34.148.128.58
;cipher=0x002f
;cipher=ECDHE-RSA-AES256-GCM-SHA384:ECDHE-RSA-AES128-GCM-SHA256

[transport-ipv4-udp-option]
type=transport
protocol=udp
bind=0.0.0.0:5061

[transport-ws]
type=transport
protocol=ws
bind=0.0.0.0:8088

[transport-wss]  
type=transport
protocol=wss
bind=0.0.0.0:8089



;===============================================================================
;===================================================UNREGISTERED TRUNK TEMPLATES
[aor-UNREG-TRUNK](!)
type=aor

[endpoint-UNREG-TRUNK](!)
type=endpoint
context=default
message_context=default-messages
disallow=all
allow=ulaw,alaw,g729,h264,vp8
dtmf_mode=info
sdp_session=bruno
allow_subscribe=yes
send_pai=yes
send_rpid=yes
identify_by=username,auth_username
mwi_subscribe_replaces_unsolicited=yes
ice_support=no
direct_media=no
force_rport=yes
rtp_symmetric=yes
rewrite_contact=yes

[identify-UNREG-TRUNK](!)
type=identify



